import React, {useMemo} from 'react'
import '../App.module.scss'

const Square = ({indexT, line, indexR}) => {
  const {rowNum, colNum} = useMemo(() => {
    return {
      rowNum: indexT + 1,
      colNum: indexR + 1,
    }
  }, [indexT, indexR ])


  return (
    <div
      className='square hovered'
      key={indexT}
      id={line.id}
    >
      {`row ${rowNum} col ${colNum}`}
    </div>
  )
}

export default Square
